import { Component } from '@angular/core';

@Component({
  selector: 'app-auth',
  templateUrl: './auth.component.html',
  styleUrls: ['./auth.component.css']
})
export class AuthComponent {
  modalOpen: boolean = false


  modaltoggle(open: boolean) {
    this.modalOpen = open
  }
}
